// Contenedor3.js


import React from 'react';
function Contenedor3() {

  return (
    <div className="contenedor3">
      <div>
      <h3>FORMATO IDEAL DE IMAGENES</h3>
      <p>fondo uniforme y contrastante</p>
      <br></br>
      </div>
      <div className='fotos'>
        <img src="v1.jpg" alt="v1" className='img'/>
        <img src="v5.jpg" alt="v5" className='img'/>
        <img src="v3.jpg" alt="v3" className='img'/>
        <img src="v4.jpg" alt="v4" className='img'/>
        <img src="v2.jpg" alt="v2" className='img'/>
        <img src="v7.jpg" alt="v7" className='img'/>

          </div>
    </div>
  );
}

export default Contenedor3;
